const navbarStyles = {
  nav: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    backgroundColor: "#333333",
    color: "#fff"
  },
  logo: {
    height: "60px",
    marginRight: "auto"
  },
  navLink: {
    color: "#fff",
    fontWeight: "bold",
    marginRight: "30px"
  },
  navBtn: {
    backgroundColor: "#fff",
    color: "#333",
    padding: "10px 10px",
    border: "none",
    borderRadius: "4px",
    cursor: "pointer"
  }
};

export default navbarStyles;
